//Drawing Functions//

//Code to write pixel information to the pixel buffer
void plot_pixel(int x, int y, short int line_color)
{
    *(short int *)(pixel_buffer_start + (y << 10) + (x << 1)) = line_color;
}

//Code to clear screen to background
void clear_screen(){
	//For each x and y position, plot black to that position
	for (int xPos = 0; xPos < X_MAX; xPos++){
		for (int yPos = 0; yPos < Y_MAX; yPos++){
			plot_pixel(xPos, yPos, backgroundColour[xPos][yPos]); //0x0000 is Blank
		}
	}
}
	
//Drawing the starting Screen to vga pixel buffer
void draw_startingScreen(){
	//For each x and y position, plot black to that position
	for (int xPos = 0; xPos < X_MAX; xPos++){
		for (int yPos = 0; yPos < Y_MAX; yPos++){
			plot_pixel(xPos, yPos, startingScreenColours[xPos][yPos]); //0x0000 is Blank
		}
	}
}
			
		
//Code to plot frog points onto buffer
void draw_frog(){
	for(int row = 0; row < 16; row++){
		for(int col = 0; col < 17; col++){
			plot_pixel(frogXPos + col, frogYPos + row, frogColour[col][row]);
		}
	}
}
		

//Code to erase frog from buffer
void erase_frog(){
	for(int row = 0; row < 16; row++){
		for(int col = 0; col < 17; col++){
			plot_pixel(prevSavedFrogPos + col, frogYPos + row, backgroundColour[prevSavedFrogPos + col][frogYPos + row]);
		}
	}
}


//Code to plot fly points onto buffer
void draw_fly(){
	for (int i = 0; i < visibleFlies; i++) {
		if (draw_fly_valid(i)){
			for(int row = 0; row < 12; row++){
				for(int col = 0; col < 10; col++){
					plot_pixel(flyXPos[i] + col, flyYPos[i] + row, flyColour[row][col]);
				}
			}
		}
	}
}

//Code to erase frog from buffer
void erase_fly(){
	for (int i = 0; i < visibleFlies; i++) {
		for(int row = 0; row < 12; row++){
			for(int col = 0; col < 10; col++){
				plot_pixel(prevSavedFlyXPos[i] + col, prevSavedFlyYPos[i] + row, backgroundColour[(int)prevSavedFlyXPos[i] + col][(int)prevSavedFlyYPos[i] + row]);
			}
		}
	}
}


//Draw the lives to pixel buffer
void draw_hearts(){
	for (int heartNum = 0; heartNum < 3; heartNum++){
		if (heartNum + 1 > numLives ){
			for (int row = 0; row < 11; row ++){
				for (int col = 0; col < 13; col++){
					plot_pixel(heartPos[heartNum] + col, 2 + row, emptyHeartColours[col][row]);
				}
			}
		}
		else{
			for (int row = 0; row < 11; row ++){
				for (int col = 0; col < 13; col++){
					plot_pixel(heartPos[heartNum] + col, 2 + row, fullHeartColours[col][row]);
				}
			}
		}

	}
}


//Erases the score
void erase_score() {
	for (int i = 0; i < 10; i++) {
		*(char *)(0xC9000000 + i) = 0;
	}
}

//Function to wait for current drawing to be completed
void wait_for_vsync(){
    volatile int * pixel_ctrl_ptr = (int *)0xFF203020;	//Address of pixel buffer
    volatile int * statusBit =(int *)0xFF20302C;	//Get S bit in status register

    *pixel_ctrl_ptr = 1;	//Request swap

    while((*statusBit & 0x01) != 0) statusBit = statusBit;	//Wait until swap is complete
}
			

//Function checks if drawdelay has reached 0 before drawing fly to screen
//Allows the staggering of fly positions.
bool draw_fly_valid(int flyIndex){
	if (flyDrawDelays[flyIndex] == 0)
			return true;
	else{
		flyDrawDelays[flyIndex] -= 1;
		return false;
	}
}


//Displays the score on the screen
void display_score() {
	int coordinates = 0;
	char score_text[] = {'0' + (score / 10), '0' + (score % 10), '\0'};
	char* char_ptr = score_text;
	char* text_ptr = "Score: ";

	//Write the word "Score: "
	while (*(text_ptr)) {
		*(char *)(0xC9000000 + coordinates) = *(text_ptr);
		++coordinates;
		++text_ptr;
	}
	
	//Write the score value
	while (*(char_ptr) != '\0') {
		*(char *)(0xC9000000 + coordinates) = *(char_ptr);
		++coordinates;
		++char_ptr;
	}
}





//Initialization Functions//

//Creates a 2D array for the background
void create_background() {
	int i = 0, j = 0;
	
	//Iterate through data array
	for (int k = 0; k < X_MAX*Y_MAX*2 - 1; k += 2) {
		
		//Create the colours
		int red = ((backgroundData[k + 1] & 0xF8) >> 3) << 11;
		int green  = (((backgroundData[k] & 0xE0) >> 5)) | ((backgroundData[k+1] & 0x7) << 3) ;		
		int blue = (backgroundData[k] & 0x1f);	

		short int colour = red | ( (green << 5) | blue);

		backgroundColour[i][j] = colour;
		
		i += 1;

		if (i == X_MAX) {
			i = 0;
			j += 1;
		}
	}
	
	i = 0;
	j = 0;
	
	//Iterate through data array for starting screen
	for (int k = 0; k < X_MAX*Y_MAX*2 - 1; k += 2) {
		
		//Create the colours
		int red = ((startingScreenData[k + 1] & 0xF8) >> 3) << 11;
		int green  = (((startingScreenData[k] & 0xE0) >> 5)) | ((startingScreenData[k+1] & 0x7) << 3) ;		
		int blue = (startingScreenData[k] & 0x1f);	

		short int colour = red | ( (green << 5) | blue);

		startingScreenColours[i][j] = colour;
		
		i += 1;

		if (i == X_MAX) {
			i = 0;
			j += 1;
		}
	}
	
}

