//Initializes the fly positions
void initialize_fly_position() {
	for (int i = 0; i < TOTAL_FLIES; i++) {
		flyXPos[i] = rand() % 310;
		flyYPos[i] = 2;
		flyDrawDelays[i] = rand()%350 + (i * 87);
		flyDirection[i] =  rand() % 2 * 2 - 1;
	}
}


//Functions for Updating game pieces //

//Updates frog pos based on key value being pressed
void update_frog_position(){
	if (moveRight){
		if (frogXPos <= 300)
			frogXPos += 4;
		else
			frogXPos = 2;
	}
	else if (moveLeft){
		if (frogXPos >= 3)
			frogXPos -=4;
		else
			frogXPos = 318;
	}
}

//Updating fly locations
void update_fly_position() {
	for (int i = 0; i < visibleFlies; i++) {
		if (draw_fly_valid(i)){ 
			if (flyUpwardsDirection[i] == 0 || flyYPos[i] <= 30){
				flyUpwardsDirection[i] = 0;
				flyYPos[i] += flySpeed;
			}
			else if (flyYPos[i] > 30){
				flyYPos[i] -= flySpeed;
				flyUpwardsDirection[i] -= 1;
			}
			//Once score is above 10 points, enable diagonal flies!
			if (score >= 10) {
				flyXPos[i] += flyDirection[i];
				if (flyXPos[i] == 0 || flyXPos[i] == X_MAX - 9) {
					flyDirection[i] = flyDirection[i] * -1;
				}
				
				if (flyYPos[i] > 30 && flyUpwardsDirection[i] == 0){
					int chanceFlyUp = rand() %150;
					if (chanceFlyUp < 1){
						flyUpwardsDirection[i] = rand() %10 + 10;
					}
				}
				
			}
		}

		//If fly reaches bottom, respawn
		if (flyYPos[i] >= Y_MAX - 20) {
			flyYPos[i] = 0;
			flyXPos[i] = rand() % 310;
			flyDrawDelays[i] = rand()%200 + (i * rand()%200);
			lose_life();
		}
	}
}


//Checks for intersecting hitboxes between frog and fly
void check_collision(){
	for(int i = 0; i < visibleFlies; i++){
		if ((flyYPos[i] + 9 >= frogYPos) && (flyXPos[i] + 10 >= frogXPos) && (flyXPos[i] <= frogXPos + 15)){
			increase_score(i);
			return;
		}
	}
	return;
}


//Every time frog collides with fly, increase score
void increase_score(int flyIndex){
	flyXPos[flyIndex] = rand() %310; 
	flyYPos[flyIndex] = 2;
	flyDrawDelays[flyIndex] = rand()%230 + (flyIndex * rand() %137);
	if (visibleFlies < TOTAL_FLIES){
		visibleFlies += 1;
	}
	score++;

	//Every 20 points increase the fly speed
	if (score != 0 && score % 20 == 0) {
		flySpeed+= 1;
	}
}


//If lives reaches0, game over
bool check_gameOver(){
	if (numLives == 0)
		return true;
	else
		return false;
}

//Reset routine at end of game
void reset_game(){
	frogXPos = INITIAL_xPOS;
	visibleFlies = 1;
	numLives = 3;
	initialize_fly_position();
	erase_score();
	score = 0;
	flySpeed = 1;
	onStartingScreen = true;
}


//If fly reaches bottom without being hit by frog, lose life
void lose_life(){
	numLives-=1;
}



//** Setting up Interrupts **//
/* Most of the code for interupts was taken from intel's document:
"using the ARM Generic Interrupt Controller", where a full example program
using interrupts was provided.

The example program was "Appendix B: Example C Program" on page 17.

This code was adapted to fit to PS2 Interrupts and the logic we wanted
*/

/* setup the PS2 interrupts in the FPGA */
void config_PS2() {
	volatile int * PS2_ptr = (int *) 0xFF200100; // Ps2 base address
	*(PS2_ptr + 1) = 0xF; // enable interrupt
}


// Define the IRQ exception handler
void __attribute__((interrupt)) __cs3_isr_irq(void) {
	// Read the ICCIAR from the CPU Interface in the GIC
	int interrupt_ID = *((int *)0xFFFEC10C);
	if (interrupt_ID == 79) // check if interrupt is from the PS2
		PS2_ISR();
	else
		while (1); // if unexpected, then stay here
	// Write to the End of Interrupt Register (ICCEOIR)
	*((int *)0xFFFEC110) = interrupt_ID;
}


// Define the remaining exception handlers
void __attribute__((interrupt)) __cs3_reset(void) {
	while (1);
}
void __attribute__((interrupt)) __cs3_isr_undef(void) {
	while (1);
}
void __attribute__((interrupt)) __cs3_isr_swi(void) {
	while (1);
}
void __attribute__((interrupt)) __cs3_isr_pabort(void) {
	while (1);
}
void __attribute__((interrupt)) __cs3_isr_dabort(void) {
	while (1);
}
void __attribute__((interrupt)) __cs3_isr_fiq(void) {
	while (1);
}



/*
* Turn off interrupts in the ARM processor
*/
void disable_A9_interrupts() {
	int status = 0b11010011;
	asm("msr cpsr, %[ps]" : : [ps] "r"(status));
}



/*
* Initialize the banked stack pointer register for IRQ mode
*/
void set_A9_IRQ_stack() {
	int stack, mode;
	stack = 0xFFFFFFFF - 7; // top of A9 onchip memory, aligned to 8 bytes
	/* change processor to IRQ mode with interrupts disabled */
	mode = 0b11010010;
	asm("msr cpsr, %[ps]" : : [ps] "r"(mode));
	/* set banked stack pointer */
	asm("mov sp, %[ps]" : : [ps] "r"(stack));
	/* go back to SVC mode before executing subroutine return! */
	mode = 0b11010011;
	asm("msr cpsr, %[ps]" : : [ps] "r"(mode));
}



/*
* Turn on interrupts in the ARM processor
*/
void enable_A9_interrupts() {
	int status = 0b01010011;
	asm("msr cpsr, %[ps]" : : [ps] "r"(status));
}


/*
* Configure the Generic Interrupt Controller (GIC)
*/
void config_GIC() {
	config_interrupt (79, 1); // configure the PS2 interrupt (79)
	// Set Interrupt Priority Mask Register (ICCPMR). Enable interrupts of all
	// priorities
	*((int *) 0xFFFEC104) = 0xFFFF;
	// Set CPU Interface Control Register (ICCICR). Enable signaling of
	// interrupts
	*((int *) 0xFFFEC100) = 1;
	// Configure the Distributor Control Register (ICDDCR) to send pending
	// interrupts to CPUs
	*((int *) 0xFFFED000) = 1;
}


/*
* Configure Set Enable Registers (ICDISERn) and Interrupt Processor Target
* Registers (ICDIPTRn). The default (reset) values are used for other registers
* in the GIC.
*/
void config_interrupt(int N, int CPU_target) {
	int reg_offset, index, value, address;
	/* Configure the Interrupt Set-Enable Registers (ICDISERn).
	* reg_offset = (integer_div(N / 32) * 4
	* value = 1 << (N mod 32) */
	reg_offset = (N >> 3) & 0xFFFFFFFC;
	index = N & 0x1F;
	value = 0x1 << index;
	address = 0xFFFED100 + reg_offset;
	/* Now that we know the register address and value, set the appropriate bit */
	*(int *)address |= value;
	/* Configure the Interrupt Processor Targets Register (ICDIPTRn)
	* reg_offset = integer_div(N / 4) * 4
	* index = N mod 4 */
	reg_offset = (N & 0xFFFFFFFC);
	index = N & 0x3;
	address = 0xFFFED800 + reg_offset + index;
	/* Now that we know the register address and value, write to (only) the
	* appropriate byte */
	*(char *)address = (char)CPU_target;
}


//ISR
void PS2_ISR() {
	volatile int * PS2_ptr = (int *) 0xFF200100;
	int press;
	//Save 3 bytes
	press = *(PS2_ptr) & 0xFF;
	byte1 = byte2;
	byte2 = byte3;
	byte3 = press;
	
	if (byte3 == 0x6b && byte2 == 0xE0){	//Left Arrow Key Pressed
		moveLeft = true;
	}
	else if (byte3 == 0x74 && byte2 == 0xE0){ //Right Arrow Key Pressed
		moveRight = true;
	}
	else if (byte3 == 0x5A && byte2 == 0xF0){ //Start game with enter key Pressed
		onStartingScreen = false;
	}
	else if ((byte3 == 0x6b && byte2 == 0xF0 &&byte1 == 0xE0) || (byte3 == 0x74 && byte2 == 0xF0 &&byte1 == 0xE0)){
		//BreakCode - Don't Move
		moveLeft = false;
		moveRight = false;
	}
	return;
}